o -->\r\n                        <!-- /ko -->\r\n                    </div>\r\n                </li>\r\n                <!-- /ko -->\r\n            </ol>\r\n        </div>\r\n    </div>\r\n</div>\r\n<!-- /ko -->\r\n<!-- ko if: isItemsBlockExpanded() -->\r\n<div class=\"block items-in-cart iwd-items-wrapper-two\" data-bind=\"mageInit: {'collapsible':{'openedState': 'active', 'active': true}}\">\r\n    <!--<div class=\"title\" data-role=\"title\">-->\r\n        <!--<strong role=\"heading\"><span data-bind=\"text: getItemsQty()\"></span>-->\r\n            <!--&lt;!&ndash; ko if: getItemsQty() == 1 &ndash;&gt;-->\r\n            <!--&lt;!&ndash; ko i18n: 'Item in Cart' &ndash;&gt;&lt;!&ndash; /ko &ndash;&gt;-->\r\n            <!--&lt;!&ndash; /ko &ndash;&gt;-->\r\n            <!--&lt;!&ndash; ko if: getItemsQty() > 1 &ndash;&gt;-->\r\n            <!--&lt;!&ndash; ko i18n: 'Items in Cart' &ndash;&gt;&lt;!&ndash; /ko &ndash;&gt;-->\r\n            <!--&lt;!&ndash; /ko &ndash;&gt;-->\r\n        <!--</strong>-->\r\n    <!--</div>-->\r\n    <div class=\"content minicart-items\" data-role=\"content\">\r\n        <div class=\"iwd-minicart-items-wrapper-two  minicart-items-wrapper overflowed\">\r\n            <ol class=\"minicart-items\">\r\n                <!-- ko foreach: getItems() -->\r\n                <li class=\"iwd-opc-product-details product-item\">\r\n                    <div class=\"product\">\r\n                        <!-- ko foreach: $parent.elems() -->\r\n                        <!-- ko template: getTemplate() --><!-- /ko -->\r\n                        <!-- /ko -->\r\n                    </div>\r\n                </li>\r\n                <!-- /ko -->\r\n            </ol>\r\n        </div>\r\n    </div>\r\n</div>\r\n<!-- /ko -->\r\n","IWD_Opc/template/summary/tax.html":"<!--\r\n/**\r\n * Copyright \u00c2\u00a9 2015 Magento. All rights reserved.\r\n * See COPYING.txt for license details.\r\n */\r\n-->\r\n<!-- ko if: ifShowValue() && !ifShowDetails() -->\r\n<tr class=